import React from 'react';
import { styled } from '@mui/material/styles';
import Container from '@mui/material/Container';
import Button from '@mui/material/Button';
import FacebookIcon from '@mui/icons-material/Facebook'
import Google from '@mui/icons-material/Google'
import LinkedIn from '@mui/icons-material/LinkedIn';
import { IconButton } from '@mui/material';
import TextBox from '../components/small-components/TextBox';
import { Link } from 'react-router-dom';
import RoundButton from '../components/small-components/RoundButton';

const RootContainer = styled(Container)(({ theme }) => ({
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'center',
  paddingTop: theme.spacing(10),
  paddingBottom: theme.spacing(10),
  width: '70%'
}));

const FormContainer = styled('form')(({ theme }) => ({
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'center',
  width: '100%',
  marginTop: theme.spacing(2),
  marginBottom: theme.spacing(2),
}));

const ButtonWrapper = styled(Button)(({ theme }) => ({
  margin: theme.spacing(2),
}));

const SocialButtonsContainer = styled('div')(({ theme }) => ({
  display: 'flex',
  justifyContent: 'center',
  marginTop: theme.spacing(2),
}));

const SocialButtonWrapper = styled(IconButton)(({ theme }) => ({
  margin: theme.spacing(1),
}));

const SignUpLink = styled(Link)(({ theme }) => ({
  marginTop: theme.spacing(2),
}));

const SignInPage = () => {
  return (
    <>
      <h1>Sign In</h1>
      <RootContainer maxWidth="sm">
        <FormContainer>
          <TextBox title="Username" placeholder="Enter your username" />
          <TextBox title="Password" placeholder="Enter your password" />
          <SocialButtonsContainer>
            <SocialButtonWrapper color="primary">
              <Google />
            </SocialButtonWrapper>
            <SocialButtonWrapper color="primary">
              <FacebookIcon />
            </SocialButtonWrapper>
            <SocialButtonWrapper color="primary">
              <LinkedIn />
            </SocialButtonWrapper>
          </SocialButtonsContainer>
          <ButtonWrapper variant="contained" color="primary" fullWidth>
            Sign In
          </ButtonWrapper>
          <SignUpLink to="/signup">
            <RoundButton text="Sign Up" color="secondary" />
          </SignUpLink>
        </FormContainer>
      </RootContainer>
    </>
  );
};

export default SignInPage;
